import classes from './Skill.module.css';
import React from 'react';

const Skill = (props) => {
    let skillClass = classes.skillClass0;
    switch(props.value) {
        case 2: 
            skillClass += ' ' + classes.skillClass2;
            break;
        case 3: 
            skillClass += ' ' + classes.skillClass3;
            break;
        case 4: 
            skillClass += ' ' + classes.skillClass4;
            break;
        case 5: 
            skillClass += ' ' + classes.skillClass5;
            break;
        case 6: 
            skillClass += ' ' + classes.skillClass6;
            break;
        case 7:
            skillClass += ' ' + classes.skillClass7;
            break;
        case 8:
            skillClass += ' ' + classes.skillClass8;
            break;
        case 9:
            skillClass += ' ' + classes.skillClass9;
            break;
        case 10:
            skillClass += ' ' + classes.skillClass10;
            break;
        default:
            skillClass = classes.skillClass0;
    }
    return(
        <div className={classes.container}>
            <p>{props.name}</p>
            <div className={skillClass}>{props.value}</div>
        </div>
    );
}

export default Skill;
